import "./Home.css";
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();

  const addTask = async () => {
    try {
      let bodyContent = JSON.stringify({
        title: title,
      });

      let reqOptions = {
        url: "https://task-nhar.onrender.com/todo/createTodo",
        method: "POST",
        data: bodyContent,
      };

      let { data } = await axios.request(reqOptions);

      // if (data) {
      //   dispatch(setUserData(data.data));
      //   localStorage.setItem("userData", JSON.stringify(data.data));
      // }
    } catch (e) {
      console.log(e);
    }
  };

  function Log_out() {
    navigate("/Login");
    localStorage.clear();
    window.location.reload();
  }
  return (
    <form className="Task-1">
      <header className="header-1">
        <div className="Head-1">
          <h4>TODO App</h4>
        </div>
        <div className="Head-2">
          <p>Profile</p>
          <p onClick={Log_out}>Logout</p>
        </div>
      </header>
      <div className="form-3">
        <input type="text" placeholder="Title" className="input3" />
        <input type="text" placeholder="Description" className="input3" />
        <button id="Add-btn" className="input3" onClick={addTask}>
          ADD TO TASK
        </button>
      </div>
      <div className="tabel-di">
        <table className="table-1" cellspacing="0">
          <tr>
            <th>TITLE</th>
            <th>DESCRIPTION</th>
            <th>STATUS</th>
            <th>DELETE</th>
          </tr>
          <tr>
            <td>Project</td>
            <td>inprogress</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
          <tr>
            <td>Lunch</td>
            <td>at 2pm today</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
          <tr>
            <td>English Class</td>
            <td>at 8pm</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
          <tr>
            <td>Market</td>
            <td>Have to go market to buy milk at 7am</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
        </table>
      </div>
    </form>
  );
}

export default Home;
